"""Utilities for persistent PII masking in log records."""

from __future__ import annotations

import logging
import logging.config
import re
from logging import LogRecord
from pathlib import Path
from typing import Any, Dict, Iterable, Mapping, MutableMapping, Optional, Sequence

import yaml

from src.config.settings import settings

__all__ = [
    "configure_logging",
    "sanitize",
    "sanitize_record",
    "sanitize_value",
    "SanitizingFilter",
]

# --- Masking patterns -----------------------------------------------------

EMAIL_PATTERN = re.compile(r"\b[\w.%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}\b")
PHONE_PATTERN = re.compile(
    r"(?<!\d)(?:\+?90|0)?[\s\-\.]?\(?\d{3}\)?[\s\-\.]?\d{3}[\s\-\.]?\d{2}[\s\-\.]?\d{2}(?!\d)"
)
TCKN_PATTERN = re.compile(r"(?<!\d)[1-9]\d{10}(?!\d)")

MASK_REPLACEMENTS: Sequence[tuple[re.Pattern[str], str]] = (
    (EMAIL_PATTERN, "[EMAIL_MASKED]"),
    (PHONE_PATTERN, "[PHONE_MASKED]"),
    (TCKN_PATTERN, "[TCKN_MASKED]"),
)

# --- Sanitisation helpers -------------------------------------------------


def sanitize(text: str) -> str:
    """Mask Turkish national IDs, phone numbers, and emails in *text*."""

    if not text:
        return text

    masked = text
    for pattern, replacement in MASK_REPLACEMENTS:
        masked = pattern.sub(replacement, masked)
    return masked


def sanitize_value(value: Any) -> Any:
    """Recursively sanitise values that may contain PII."""

    if isinstance(value, str):
        return sanitize(value)

    if isinstance(value, Mapping):
        return {key: sanitize_value(val) for key, val in value.items()}

    if isinstance(value, list):
        return [sanitize_value(item) for item in value]

    if isinstance(value, tuple):
        return tuple(sanitize_value(item) for item in value)

    if isinstance(value, set):
        return {sanitize_value(item) for item in value}

    return value


_SANITIZE_SKIP_KEYS = {
    "args",
    "exc_info",
    "exc_text",
    "msg",
    "stack_info",
}


def sanitize_record(record: LogRecord) -> None:
    """Sanitise message, arguments, and metadata on *record* in-place."""

    if isinstance(record.msg, str):
        record.msg = sanitize(record.msg)

    if record.args:
        if isinstance(record.args, tuple):
            record.args = tuple(sanitize_value(arg) for arg in record.args)
        elif isinstance(record.args, Mapping):
            record.args = {key: sanitize_value(val) for key, val in record.args.items()}

    for attr in ("pathname", "filename", "module", "funcName", "stack_info"):
        current = getattr(record, attr, None)
        if isinstance(current, str):
            setattr(record, attr, sanitize(current))

    extras = list(record.__dict__.items())
    for key, value in extras:
        if key in _SANITIZE_SKIP_KEYS:
            continue
        if isinstance(value, str):
            record.__dict__[key] = sanitize(value)
        elif isinstance(value, (Mapping, list, tuple, set)):
            record.__dict__[key] = sanitize_value(value)


class SanitizingFilter(logging.Filter):
    """Logging filter that enforces persistent PII masking."""

    def filter(self, record: LogRecord) -> bool:  # noqa: D401 - standard filter signature
        sanitize_record(record)
        return True


# --- Logging configuration -------------------------------------------------

_DEFAULT_LOG_FORMAT = "[%(asctime)s] [%(levelname)s] [%(name)s] %(message)s"
_ROOT_LOGGER = ""
_LOGGING_CONFIGURED = False


def _build_default_config(log_file: Path) -> Dict[str, Any]:
    return {
        "version": 1,
        "disable_existing_loggers": False,
        "formatters": {
            "default": {
                "format": _DEFAULT_LOG_FORMAT,
                "datefmt": "%Y-%m-%d %H:%M:%S",
            }
        },
        "handlers": {
            "stdout": {
                "class": "logging.StreamHandler",
                "level": "INFO",
                "formatter": "default",
                "stream": "ext://sys.stdout",
            },
            "file": {
                "class": "logging.handlers.RotatingFileHandler",
                "level": "INFO",
                "formatter": "default",
                "filename": str(log_file),
                "maxBytes": 5 * 1024 * 1024,
                "backupCount": 5,
                "encoding": "utf-8",
            },
        },
        "root": {
            "level": "INFO",
            "handlers": ["stdout", "file"],
        },
    }


def _deep_update(target: MutableMapping[str, Any], updates: Mapping[str, Any]) -> MutableMapping[str, Any]:
    for key, value in updates.items():
        if (
            isinstance(value, Mapping)
            and isinstance(target.get(key), Mapping)
            and value
        ):
            target[key] = _deep_update(target[key], value)
        elif key in {"handlers", "formatters", "loggers"} and not value:
            continue
        else:
            target[key] = value
    return target


def _load_logging_config(config_path: Optional[Path]) -> Dict[str, Any]:
    log_root = Path(settings.LOG_ROOT)
    log_root.mkdir(parents=True, exist_ok=True)
    log_file = log_root / "ai4ohs.log"

    default_config = _build_default_config(log_file)

    if config_path is None:
        config_path = Path(__file__).resolve().parents[1] / "config" / "logging_conf.yaml"

    if not config_path.exists():
        return default_config

    try:
        raw_config = yaml.safe_load(config_path.read_text(encoding="utf-8")) or {}
    except yaml.YAMLError as exc:
        logging.getLogger(__name__).warning(
            "Failed to parse logging configuration %s: %s", config_path, exc
        )
        return default_config

    if not isinstance(raw_config, Mapping):
        return default_config

    merged_config = _deep_update(default_config, raw_config)
    return merged_config


def _prepare_filters(config: Dict[str, Any]) -> None:
    filters = config.setdefault("filters", {})
    filters.setdefault("sanitize", {"()": "src.utils.log_sanitize.SanitizingFilter"})

    for handler_config in config.get("handlers", {}).values():
        handler_filters: list[str] = handler_config.setdefault("filters", [])
        if "sanitize" not in handler_filters:
            handler_filters.append("sanitize")


def _prepare_handlers(config: Dict[str, Any]) -> None:
    log_root = Path(settings.LOG_ROOT)
    for handler in config.get("handlers", {}).values():
        filename = handler.get("filename")
        if filename:
            file_path = Path(filename)
            if not file_path.is_absolute():
                file_path = log_root / file_path
            file_path.parent.mkdir(parents=True, exist_ok=True)
            handler["filename"] = str(file_path)


def configure_logging(config_path: Optional[Path] = None, force: bool = False) -> None:
    """Configure application logging with persistent sanitisation."""

    global _LOGGING_CONFIGURED

    if _LOGGING_CONFIGURED and not force:
        return

    config = _load_logging_config(config_path)
    _prepare_filters(config)
    _prepare_handlers(config)

    logging.config.dictConfig(config)
    logging.captureWarnings(True)

    _LOGGING_CONFIGURED = True
